      {/* Form Container */}
      <div className="w-full max-w-md p-8 bg-white shadow-md rounded-md mt-6">
        <h2 className="text-center text-2xl font-semibold text-gray-700 mb-4">SIGN UP</h2>
        <p className="text-center text-sm text-gray-500 mb-8">Find faster, build smarter</p>

        <form>
          {/* Email Input */}
          <div className="mb-4">
            <label className="block text-gray-700">Email</label>
            <input
              type="email"
              placeholder="Please use only business email"
              className="w-full px-4 py-2 border rounded-md focus:outline-none focus:ring focus:border-blue-500"
              required
            />
            <p className="text-xs text-red-500 mt-1">
              Please use only business email. Other emails are not allowed.
            </p>
          </div>

          {/* Password Input */}
          <div className="mb-4">
            <label className="block text-gray-700">Password</label>
            <input
              type="password"
              placeholder="Password"
              className="w-full px-4 py-2 border rounded-md focus:outline-none focus:ring focus:border-blue-500"
              required
            />
          </div>

          {/* Repeat Password Input */}
          <div className="mb-6">
            <label className="block text-gray-700">Repeat Password</label>
            <input
              type="password"
              placeholder="Repeat Password"
              className="w-full px-4 py-2 border rounded-md focus:outline-none focus:ring focus:border-blue-500"
              required
            />
          </div>

          {/* Submit Button */}
          <div>
            <button
              type="submit"
              className="w-full bg-gradient-to-r from-blue-500 to-indigo-500 text-white py-2 rounded-md hover:bg-gradient-to-r hover:from-indigo-500 hover:to-blue-500 transition"
            >
              SIGN UP
            </button>
          </div>
        </form>

        <p className="text-center text-sm text-gray-600 mt-4">
          Already have an account?{' '}
          <a href="/login" className="text-blue-500 hover:underline">
            Log in
          </a>
        </p>
      </div>
